import React from 'react'
import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <>  
          <div className="headerLine">
            <ul className="left">
                <li><Link to="/">Achar</Link></li>
            </ul>
            <ul className="right">
                <li><Link to="cart"><span className="shopingLogo"><i class="fas fa-shopping-cart"></i><span className="cartCount">0</span></span></Link></li>
            </ul>
          </div>  
        </>
    )
}

export default Navbar;
